import UrlDisplay from "../components/UrlDisplay";
import UrlInput from "../components/UrlInput";

const Homepage: React.FC = () => {
  const [url, setUrl] = useState<string>("");
  return (
    <div>
      <UrlInput />
      <UrlDisplay />
    </div>
  );
};

export default Homepage;
